import React from "react";
import { Spring, config } from "react-spring/renderprops";
import "./App.css";

function NavBar() {
  return (
    <Spring from={{ number: 0 }} to={{ number: 600 }} config={config.slow}>
      {props => (
        <div style={{ width: props.number + "%" }}>
          <nav className="nav-bar">
            <a href="#">Home</a>
            <a href="#"> Posts</a>
            <a href="#">Contact</a>
          </nav>
        </div>
      )}
    </Spring>
  );
}

export default NavBar;
